function App() {
  return (
      <div>
          <div style={{
              backgroundImage : "url("+ image+")",
              backgroundSize: "cover",
              opacity: 0.5,
              backgroundPosition: "top center",
              minHeight:'100vh',
              height: "auto"}}>
              <Grid
                  container
                  direction="row"
                  justify="flex-end"
                  alignItems="center">
                  <Grid style={{
                      width:200,
                      height:500,
                      backgroundColor: 'white'
                  }}>

                  </Grid>

              </Grid>
          </div>
      </div>
  );
}

export default App;
